@SaninPazC Ellos son la grotesca caricatura de una izquierda que no ha hecho la 
revolución que hoy sólo atina a jugar el rol electoral a sabiendas del carácter fraudulento e inocuo de ser Gob.
Su carácter suicida se diferencia de los "especialistas sin espíritu y hedonistas sin corazón".
